def find_safety(ee, prev=''):
    for i in ee:
        if i.lower() == 'safetyAndAccessibility'.lower() and prev.lower() == 'hotelContent'.lower():
            return True
    return False

prev_freq_map = {}
prev = None
for k,v in _PREV_FREQ_MAP.items():
    ee = k.split('.')
    found_safety = False
    if find_safety(ee, prev):
        prev_freq_map[k] = k.lower().replace('hotelcontent.safetyandaccessibility', 'hotelInfo.safetyAndAccessibility')
    else:
        prev_freq_map[k] = v
    prev = k

i = 0
# def set_facilities():
try:
    for k,v in prev_freq_map.items():
        if 'hotelinfo.facilities.' in v.lower():
            i += 1
            if 'hotelContent.meetingServices.' in k.lower():
                prev_freq_map[k] = k.lower().replace('hotelContent.meetingServices','hotelinfo.facilities.meetingServices')
            if '.feeBasedServices' in k.lower():
                prev_freq_map[k] = k.lower().replace('hotelcontent.guestservices.feeBasedServices','hotelinfo.fees')
            if '.safetyAndAccessibility' in k.lower():
                prev_freq_map[k] = k.lower().replace('hotelcontent.safetyandaccessibility','hotelinfo.facilities.safetyandaccessibility')
            if 'hotelContent.rooms' in k.lower():
                prev_freq_map[k] = k.lower().replace('hotelcontent.rooms','hotelinfo.facilities.rooms')
            if '.publicareas' in k.lower():
                prev_freq_map[k] = k.lower().replace('hotelcontent.','hotelinfo.')
except Exception:
    print('--------------EXCEPTION OCCURRED--------------')
    import pdb; pdb.set_trace()

with open('_FIXED_attribute_map.py', 'a') as open_file:
    open_file.write('prev_freq_map = {0}'.format(str(prev_freq_map)))

